package main

import (
	"testing"
)

var empty string = ""
var notEmpty string = "teste"
var notEmptyBig string = "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa"
var notEmptyReallyBig string = ""

func BenchmarkStringEmptyLen(b *testing.B) {
	for i := 0; i < b.N; i++ {
		_ = len(empty) > 0
		_ = len(notEmpty) > 0
		_ = len(notEmptyBig) > 0
		_ = len(notEmptyReallyBig) > 0
	}

	b.StopTimer()
}

func BenchmarkStringEmptyEmpty(b *testing.B) {
	for i := 0; i < b.N; i++ {
		_ = empty == ""
		_ = notEmpty == ""
		_ = notEmptyBig == ""
		_ = notEmptyReallyBig == ""
	}

	b.StopTimer()
}
